  margin-top: 2rem;
}

.faq__shadow-oil-recipe,
.faq__gspp-recipe {
  align-items: center;
  display: grid;
  grid-template-rows: repeat(3, 1fr);
  grid-template-columns: 1fr 3fr;
}

.faq__item--1 {
  justify-items: center;
  align-items: center;
  display: grid;
  grid-template-rows: 1fr 1fr;
}
