.map-btn-left {
  border-radius: 25px 0px 0px 25px;
}

.map-btn-right {
  border-radius: 0px 25px 25px 0px;
}

.map__selector {
  margin-bottom: 2rem;
  position: relative;
  display: inline-block;
}

