  margin-left: 3rem;
  margin-right: 3rem;
  text-align: start;
}

.herb.section__header {
  margin-left: 5rem;
  margin-right: 5rem;
}

.herb__content {
  display: flex;
  flex-direction: column;
  overflow: hidden;
  align-items: center;
}

.herb__content img {
  height: 250px;
  width: auto;
  border: 1px solid black;
}

.herb__totals {
  display: flex;
  flex-direction: column;
  align-items: center;
}

