  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  max-width: 70rem;
  padding: 5rem 6rem;
  z-index: 1000;
  display: flex;
  flex-direction: column;
}

.overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.5);
  z-index: 100;
}

.btn--close-modal {
  font-family: inherit;
  color: white;
  position: absolute;
  top: -1rem;
  right: 2rem;
  font-size: 3.5rem;
  cursor: pointer;
  border: none;
  background: none;
}

.btn--select-herb {
  background-color: darkred;
  padding: 1rem;
  margin: 0.2rem;
  border: none;
  display: flex;
  flex-direction: row;
  border-radius: 25px 25px 25px 25px;
  position: relative;
  align-items: center;
  justify-content: center;
  align-content: center;
}

.modal__select-herb-container {
  display: flex;
  flex-direction: column;
}

.modal__select-herb-container h1 {
  position: relative;
}

.modal__filler {
  flex-grow: 1;
  background: inherit;
}

.modal__header {
  font-size: 2rem;
  margin-top: 4.5rem;
}

.modal img {
  max-height: 2rem;
}

/* FOOTER */
.footer {
  padding-top: 8rem;
  padding-left: 3rem;
  padding-right: 3rem;
  padding-bottom: 2rem;
  background-image: linear-gradient(
    to bottom right,
    rgb(129, 129, 129),
    rgb(51, 51, 51)
  );
  text-align: center;
}

.footer img {
  margin-bottom: 2rem;
  height: 55px;
}

.footer a {
  text-decoration: none;
}

.footer__socials {
  display: flex;
  flex-direction: row;
  align-content: center;
  justify-content: center;
  margin: 1rem;
}

.footer li {
  margin: 1rem;
}

